pragma solidity ^0.4.18;
import 'zeppelin-solidity/contracts/token/ERC20/StandardToken.sol';
import "zeppelin-solidity/contracts/ownership/Ownable.sol";

contract TestToken is StandardToken, Ownable {
    string public name = "CyberMiles Test Token";
    string public symbol = "TEST";
    uint public decimals = 18;
    uint public INITIAL_SUPPLY = 100000000000000000000000000;
    function TestToken() public {
        totalSupply_ = INITIAL_SUPPLY;
        balances[msg.sender] = INITIAL_SUPPLY;
    }
    function kill() public onlyOwner {
      if (owner == msg.sender) { // We check who is calling
        selfdestruct(owner); //Destruct the contract
      }
    }
    function() public payable { }
}
